import React, { ReactElement } from 'react';

const carrierIconsMapper = {
  None: NoneIcon,
  Aetna: AetnaIcon,
  Ambetter: AmbetterIcon,
  Avmed: AvmedIcon,
  'BlueCross BlueShield': BlueCrossBlueShieldIcon,
  Cigna: CignaIcon,
  'Florida Blue': FloridaBlueIcon,
  'Friday Health Plans': FridayHealthPlansIcon,
  Molina: MolinaIcon,
  Oscar: OscarIcon,
  'UnitedHealthcare (UHC)': UnitedHealthcareIcon,
};

export type CarrierIconProps = {
  icon: CarrierIconKey;
  twClasses: string;
};

export type CarrierIconKey = keyof typeof carrierIconsMapper;

export function CarrierIcon({ icon, twClasses }: CarrierIconProps): ReactElement {
  const IconComponent = carrierIconsMapper[icon];
  return (
    <svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 50' className={twClasses}>
      <title>{icon}</title>
      <IconComponent />
    </svg>
  );
}

